    margin:0 0 15px}

#mahirushiina button{padding:10px 20px;border:0;background:rgba(0,0,0,.15);color:#fff;margin:20px 5px;

#mahirushiina button:hover{background:rgba(0,0,0,.35);color:#fff;outline:none}
#mahirushiina button.active,
#mahirushiina button:hover.active{background:#fff;color:#222;outline:none}
#mahirushiina .fixblock{background:#fff;text-align:left;color:#000;padding:20px;height:250px;overflow:auto;

#mahirushiina .fixblock div{display:none}
#mahirushiina .fixblock div.active{display:block;animation:fadeInUp .5s}
